UML:TaggedValue.value:
A Schema is a NameSpace for metaclass objects that each describes a class, type, interface or record type.

It has a local name for location in a larger name space scope, and a mapping that indexed the names of any named object. Targets of this index are usually locally described. 

{description->contains(n) implies locate(n.typeName) =n}

Record is a indexed set of objects. It can be associated to a RecordType in such a manner that the class of an indexed value object is of the class specified by the RecordType's correspondingly indexed TypeName. 
A Record  is a NameSpace for its included attributes.

{locate() = attributes.select()}
                                            -- Record acts as a dictionary on its attributes

{isTypeOf.attribute.select(C)(recordType.attributeTypes.select(C)) }       
                                             -- the type of each attribute is given in the associated RecordType

{ forEvery n : MemberName -> locate(n) = memberValue(n)}
          -- Record acts as a dictionary on its attributes

{ forEvery n : MemberName -> isTypeOf.memberValue(n)(recordType.memberType(n)) }       
          -- the type of each attribute is given in the associated RecordType

A RecordSchema is a collection of RecordTypes indexed by their TypeNames. RecordSchemas can be aggregated in a NameSpace into what are essentially larger schemas.
A RecordSchema forms a NameSpace for its typeDescriptions targets (values).  

{description.isTypeOf(RecordType)}
